theDates = [
    '2020-08-27T01:11:13.000Z',
    '2020-09-27T01:11:13.000Z',
    '2020-10-27T01:11:13.000Z'
]

export const greatestDate = (date, dateArray) => {
    let checkdate = date
    dateArray.forEach(element => {
        date > element ? checkdate = date : checkdate = element
    });
    return checkdate
}
